import {React} from 'react';

function ProductInfo ({title, image, price, color, type, id}) {

    return (
        <div>
            <h1>{title}</h1>
            <img src={image}></img>
            <p>Product information:</p>
            <p>{price}</p>
            <p>{color}</p>
            <p>{type}</p>
        </div>
    );

}

export default ProductInfo;
